import React, { useState } from "react";

export default function Dashboard() {
  return (
    <div className="row text-center">
        <div className="col col-sm-4">
      <button type="submit" className="btn btn-primary px-5 mb-5 w-100">
        Time Table
      </button>
      </div>
      <div className="col col-sm-4">
      <button type="submit" className="btn btn-primary px-5 mb-5 w-100">
        Students
      </button>
      </div>
    </div>
  );
}
